import React, { Suspense } from "react"
import { Route } from "react-router"
import Loader from "../../reuseable/Loader/Loader"

const converterRoutes = ({match}) => {

    const Converter = React.lazy(()=>import("./Converter"))

    return (
        <Suspense fallback={<Loader/>}>
            <Route path={match.path} component={Converter}/>
        </Suspense>
    )
}

export default converterRoutes
